import Nav from './components/Nav';
import './App.css';
import { Route } from 'react-router-dom';
import Footer from './components/Footer';
import Home from './components/Home';
import Sound from 'react-sound';

function App() {
  return (
    <div className='App'>
      <Route path='/'>

      <Home />
      < Nav />
      </Route>
      <h1>Overall Winner</h1>
      <Footer />
    </div>
  );
}

export default App;
